function circleOnMap(o,e){try{for(m of o)0!=m.SBIKE_PARKING_CNT?(L.marker([m.SBIKE_X,m.SBIKE_Y],{icon:L.icon({iconUrl:"../../static/images/ui/marker_bicycle.png",iconSize:[30,36],iconAnchor:[22,15],popupAnchor:[-7,2]})}).bindPopup(`<strong>${m.SBIKE_SPOT_NM}</strong><br><br><div class="bike-count-bubble">${m.SBIKE_PARKING_CNT}${translateBike(userLocale())}</div>`).addTo(e),L.marker([m.SBIKE_X,m.SBIKE_Y],{icon:L.divIcon({html:`<div class="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-danger">${m.SBIKE_PARKING_CNT}</div>`,iconSize:[0,0],iconAnchor:[-10,12]})}).addTo(e)):(L.marker([m.SBIKE_X,m.SBIKE_Y],{icon:L.icon({iconUrl:"../../static/images/ui/marker_no_bicycle.png",iconSize:[30,36],iconAnchor:[22,15],popupAnchor:[-7,2]})}).bindPopup(`<strong>${m.SBIKE_SPOT_NM}</strong><br><br><div class="bike-count-bubble">${m.SBIKE_PARKING_CNT}${translateBike(userLocale())}</div>`).addTo(e),L.marker([m.SBIKE_X,m.SBIKE_Y],{icon:L.divIcon({html:`<div class="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-secondary">${m.SBIKE_PARKING_CNT}</div>`,iconSize:[0,0],iconAnchor:[-10,12]})}).addTo(e))}catch{return void console.log("서버 데이터 확인 필요")}}document.addEventListener("DOMContentLoaded",()=>{try{const o=bikeData[0].SBIKE_X,e=bikeData[0].SBIKE_Y;console.log(o,e);let n=L.map("map",{center:[o,e],zoom:16});L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png",{maxZoom:19,attribution:"&copy; OpenStreetMap contributors"}).addTo(n),circleOnMap(bikeData,n)}catch{const o=document.createElement("div");o.textContent="No bike available",o.classList.add("no-bike"),document.getElementById("map").appendChild(o)}});